import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../images/logo.png';
import './HeaderStyle.css';

function Header() {

    return (
        <div className="container-fluid">

            <nav className="navbar navbar-wrapper navbar-expand-sm bg-secondary navbar-dark sticky-top">
                <Link className="nav-link" to="/home"><img className="card-img-top" src={logo} style={{ width: "35px", height: "35px" }} alt="Card image" /></Link>

                <ul class="nav justify-content-end">
                    <li className="nav-item">
                        <Link className="nav-link" to="/">Dashboard</Link>
                    </li>



                    <li className="nav-item">
                        <Link className="btn btn-warning my-2 my-sm-0 mx-2" to="/user/add">Register</Link>
                    </li>
                    <li className="nav-item">
                        <Link className="btn btn-danger my-2 my-sm-0" to="/home">Logout</Link>
                    </li>




                </ul>

            </nav>
        </div>
    )
}



export default Header;
